import Colors from '../constants/colors';


export default class index extends React.Component {

    static async getInitialProps() {
        return {}
    }

    render() {
        return (
            <div>
                <div className="navBar"> 
                <h1>Hello</h1> </div>

                <style jsx>
                    {`
                        .navBar{
                            height: 72px;
                            width: 100%;
                            background: white;
                            justifyContent: center,
                            
                        }
                  `}
                </style>

                <style global jsx>
                    {`
                        body {
                            background: ${Colors.lightGrey};
                            margin: 0;
                            padding: 0;
                            border: 0;
                        }
                       
                    `}
                </style>

            </div>
        )

    }



}
